  `id` int(10) NOT NULL auto_increment,
  `name` varchar(30) NOT NULL,
  `email` varchar(50) NOT NULL,
  `message_matter` varchar(255) NOT NULL,
  PRIMARY KEY  (`id`,`email`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;

